    fetch('https://dummyjson.com/products/1').then((data)=>{
        data.json().then(result =>{
            console.log(result);
            setUser(result.data)
        })
    })
  },[])
  return (
    <>
   <div>
    {
        user.map((products,index )=>{
            <h1 key={index}>{products.id}</h1>

        })
    }
   </div>

    </>
  );
};

export default Api;
